  `parent_id` int(11) DEFAULT '0' COMMENT '父部门id',
  `parent_ids` varchar(255) DEFAULT NULL COMMENT '祖先id路径，全部祖先id自上而下拼接的字符串：约定格式如下：[0],[1],[2],',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `edit_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `sort` int(11) DEFAULT NULL COMMENT '排序值，用来确定同级部门显示的先后顺序，正整数',
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '数据插入时间',
  `lastupdate` datetime DEFAULT NULL,
  `status` int(11) DEFAULT '1',
  PRIMARY KEY (`id`),
  UNIQUE KEY `department_name_uindex` (`name`)
