-- ----------------------------
-- Table structure for t_finance
-- ----------------------------
DROP TABLE IF EXISTS `t_finance`;
CREATE TABLE `t_finance` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间',
  `add_admin` bigint(20) DEFAULT '0' COMMENT '录入人员',
  `mobile` varchar(255) DEFAULT NULL COMMENT '联系方式',
  `user_name` varchar(255) DEFAULT NULL COMMENT '用户姓名',
  `user_mobile` varchar(255) DEFAULT '' COMMENT '用户手机号码',
  `id_number` varchar(255) DEFAULT NULL COMMENT '身份证号码',
  `policy` varchar(255) DEFAULT NULL COMMENT '政策',
  `referee` varchar(255) DEFAULT NULL COMMENT '推荐人',
  `referee_department` bigint(255) DEFAULT '0' COMMENT '推荐人部门',
  `referee_department_ids` bigint(20) DEFAULT '0' COMMENT '推荐人部门子部门',
  `product_type_id` bigint(20) DEFAULT '1' COMMENT '产品类型id',
  `product_id` bigint(20) DEFAULT '0' COMMENT '产品id',
  `card_no` varchar(255) DEFAULT NULL COMMENT '卡号',
  `card_name` varchar(255) DEFAULT NULL COMMENT '卡名称',
  `amount` decimal(20,2) DEFAULT '0.00' COMMENT '金额',
  `apr` decimal(10,2) DEFAULT '0.00' COMMENT '年利率',
  `completion_time` timestamp NULL DEFAULT NULL COMMENT '完款时间',
  `period_unit` int(11) DEFAULT '0' COMMENT '期限-1: 年;0:月;1:日;',
  `period` int(11) DEFAULT '0' COMMENT '期限',
  `deposit` decimal(10,2) DEFAULT '0.00' COMMENT '定金',
  `bank_name` varchar(255) DEFAULT NULL COMMENT '开户行',
  `bank_no` varchar(255) DEFAULT NULL COMMENT '银行卡帐号',
  `couplet_number` varchar(255) DEFAULT NULL COMMENT '联行号',
  `pos_no` varchar(255) DEFAULT NULL COMMENT 'pos机终端号，多个终端号以逗号隔开',
  `pos_amount` varchar(255) DEFAULT NULL COMMENT 'pos机刷卡金额，多个以逗号隔开',
  `accounts_bank_no` varchar(255) DEFAULT NULL COMMENT '转账银行尾号，多个以逗号隔开',
  `accounts_bank_amount` varchar(255) DEFAULT NULL COMMENT '银行转账金额，多个以逗号隔开',
  `account_service` decimal(20,2) DEFAULT '0.00' COMMENT '转账手续费',
  `ticket_img` varchar(255) DEFAULT NULL COMMENT '票务图片，多个以逗号隔开',
  `status` int(10) DEFAULT '0' COMMENT '状态：\r\n0，已录入\r\n1，财务金额核对通过\r\n-1，财务金额核对未通过\r\n2，财务已开收据\r\n-2，财务开收据未通过\r\n3，财务已寄出合同\r\n4，分公司财务已寄出合同\r\n5，稽核客户信息\r\n-5，稽核信息未通过\r\n6，退款\r\n7，升级\r\n\r\n',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `check_remarks` varchar(255) DEFAULT NULL COMMENT '核对金额备注',
  `check_time` timestamp NULL DEFAULT NULL COMMENT '核对时间',
  `check_admin` bigint(20) DEFAULT '0' COMMENT '核对人',
  `card_time` timestamp NULL DEFAULT NULL COMMENT '录入卡号时间',
  `card_admin` bigint(20) DEFAULT '0' COMMENT '录入卡号人员',
  `logistics_id` bigint(10) DEFAULT '0' COMMENT '物流公司ID',
  `logistics_no` varchar(255) DEFAULT NULL COMMENT '物流编号',
  `logistics_time` timestamp NULL DEFAULT NULL COMMENT '物流增加时间',
  `logistics_admin` bigint(20) DEFAULT '0' COMMENT '物流添加人',
  `agreement_logistics_id` bigint(20) DEFAULT '0' COMMENT '协议签订邮寄物流id',
  `agreement_logistics_no` varchar(255) DEFAULT NULL COMMENT '协议签订邮寄物流号',
  `agreement_logistics_time` timestamp NULL DEFAULT NULL COMMENT '协议签订物流增加时间',
  `agreement_logistics_admin` bigint(255) DEFAULT '0' COMMENT '协议签订物流添加人',
  `contract_img` varchar(255) DEFAULT NULL COMMENT '合同图片',
  `audit_time` timestamp NULL DEFAULT NULL COMMENT '稽核时间',
  `audit_admin` bigint(20) DEFAULT '0' COMMENT '稽核人员',
  `address` varchar(255) DEFAULT NULL COMMENT '用户地址',
  `agreement_time` timestamp NULL DEFAULT NULL COMMENT '收到协议时间',
  `audit_remarks` varchar(500) DEFAULT NULL COMMENT '稽核备注',
  `is_new_user` int(1) DEFAULT '0' COMMENT '是否新会员 1是，2，否',
  `card_day` int(10) DEFAULT '0' COMMENT '卡内天数',
  `marital` int(2) DEFAULT '0' COMMENT '婚姻情况 1已婚 2未婚',
  `emergency_contact_name` varchar(255) DEFAULT NULL COMMENT '紧急联系人姓名',
  `emergency_contact_mobile` varchar(255) DEFAULT NULL COMMENT '紧急联系人电话',
  `occupation` varchar(255) DEFAULT NULL COMMENT '职业',
  `posts` varchar(255) DEFAULT NULL COMMENT '职务',
  `service_unit` int(2) DEFAULT '0' COMMENT '供职单位1,国家行政机关 2,科研机构,3.国有企业,4.民营企业 5,外商独资企业 6,中外合资企业 7.院校 8,部队 9.自由职业者',
  `personal_hobbies1` int(1) DEFAULT '0' COMMENT '个人爱好(多选)旅行',
  `personal_hobbies2` int(1) DEFAULT '0' COMMENT '个人爱好(多选)音乐',
  `personal_hobbies3` int(1) DEFAULT '0' COMMENT '个人爱好(多选)运动',
  `personal_hobbies4` int(1) DEFAULT '0' COMMENT '个人爱好(多选)摄影',
  `personal_hobbies5` int(1) DEFAULT '0' COMMENT '个人爱好(多选)棋牌',
  `personal_hobbies6` int(1) DEFAULT '0' COMMENT '个人爱好(多选)其他',
  `understanding_channels` int(1) DEFAULT '0' COMMENT '了解渠道 1,听广播 2,网络搜索 3,朋友推荐 4,宣传单页 5,其他',
  `upgrade_time` timestamp NULL DEFAULT NULL COMMENT '退款/升级时间',
  `lastupdate` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `index_finance_id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15205 DEFAULT CHARSET=utf8 COMMENT='录入信息表';

