  `sign` varchar(512) DEFAULT NULL COMMENT '签名',
  `sign_type` varchar(10) DEFAULT NULL COMMENT '签名类型',
  `notify_timestamp` varchar(32) DEFAULT NULL,
  `total_amount` decimal(11,0) DEFAULT NULL COMMENT '订单⾦额',
