-- ----------------------------
-- Table structure for t_pay_alipay_order
-- ----------------------------
DROP TABLE IF EXISTS `t_pay_alipay_order`;
CREATE TABLE `t_pay_alipay_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `lastupdate` datetime DEFAULT NULL,
  `status` int(1) DEFAULT '1',
  `is_del` int(2) DEFAULT '0',
  `pay_type` int(4) DEFAULT NULL COMMENT '1、pc⽹⻚⽀付 2、wap ⽹⻚⽀付 3、app⽀付 4、扫码付',
  `body` varchar(1000) DEFAULT NULL COMMENT '订单描述',
  `subject` varchar(128) DEFAULT NULL COMMENT '订单标题',
  `price` decimal(11,4) DEFAULT NULL COMMENT '订单⾦额',
  `out_trade_no` varchar(128) DEFAULT NULL,
  `return_url` varchar(255) DEFAULT NULL COMMENT '同步⻚⾯',
  `notifys_url` varchar(255) DEFAULT NULL COMMENT '异步通知地址',
  `pay_status` int(4) DEFAULT NULL COMMENT '⽀付状态',
  `close_time` datetime DEFAULT NULL COMMENT '订单关闭时间',
  `pay_success_time` datetime DEFAULT NULL COMMENT '成功⽀付时间',
  `memo` varchar(400) DEFAULT NULL COMMENT '备注',
  `transaction_id` varchar(128) DEFAULT NULL COMMENT '⽀付异步回调存储',
  `refund_status` int(1) DEFAULT '0' COMMENT '退款状态 0 未退款 1部分退款 2全部退款',
  `refund_no` varchar(129) DEFAULT NULL COMMENT '退款编号',
  `refund_amount` decimal(11,4) DEFAULT NULL COMMENT '退款⾦额',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8 COMMENT='⽀付宝⽀付订单';

-- ----------------------------
-- Records of t_pay_alipay_order
-- ----------------------------

-- ----------------------------
-- Table structure for t_pay_alipay_query
-- ----------------------------
DROP TABLE IF EXISTS `t_pay_alipay_query`;
CREATE TABLE `t_pay_alipay_query` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `lastupdate` datetime DEFAULT NULL,
  `status` int(1) DEFAULT '1',
  `is_del` int(2) DEFAULT '0',
  `msg` varchar(12) DEFAULT NULL,
  `code` varchar(12) DEFAULT NULL COMMENT '开发者的app_id',
  `buyer_user_id` varchar(16) DEFAULT NULL COMMENT '买家在⽀付宝的⽤户id ',
  `send_pay_date` datetime DEFAULT NULL COMMENT '本次交易打款给卖家的时间 ',
  `invoice_amount` decimal(11,4) DEFAULT NULL COMMENT '交易中⽤户⽀付的可开具发票的⾦额，单位为元，两位⼩数。该⾦额代表该笔交易中可以给⽤户开具发票的⾦额 ',
  `out_trade_no` varchar(64) DEFAULT NULL COMMENT ' 商家订单号 ',
  `total_amount` decimal(11,4) DEFAULT NULL COMMENT '交易的订单⾦额，单位为元，两位⼩数。该参数的值为⽀付时传⼊的total_amount',
  `trade_status` varchar(32) DEFAULT NULL COMMENT '交易状态：WAIT_BUYER_PAY（交易创建，等待买家付款）、TRADE_CLOSED（未付款交易超时关闭，或⽀付完成后全额退款）、TRADE_SUCCESS（交易⽀付成功）、TRADE_FINISHED（交易结束，不可退款）',
  `trade_no` varchar(64) DEFAULT NULL COMMENT '⽀付宝交易号，和商户订单号不能同时为空 ',
  `buyer_logon_id` varchar(100) DEFAULT NULL COMMENT '买家⽀付宝账号 ',
  `receipt_amount` decimal(11,0) DEFAULT NULL COMMENT '实收⾦额，单位为元，两位⼩数。该⾦额为本笔交易，商户账户能够实际收到的⾦额 ',
  `point_amount` decimal(11,4) DEFAULT NULL COMMENT '积分⽀付的⾦额，单位为元，两位⼩数。该⾦额代表该笔交易中⽤户使⽤积分⽀付的⾦额，⽐如集分宝或者⽀付宝实时优惠等 ',
  `buyer_pay_amount` decimal(11,4) DEFAULT NULL COMMENT '买家实付⾦额，单位为元，两位⼩数。该⾦额代表该笔交易买家实际⽀付的⾦额，不包含商户折扣等⾦额 ',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=49 DEFAULT CHARSET=utf8 COMMENT='⽀付宝⽀付查询';

-- ----------------------------
-- Records of t_pay_alipay_query
-- ----------------------------

