  `lastupdate` datetime DEFAULT NULL,
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '状态（0 正常 1 禁用）',
  `audit_status` int(1) NOT NULL DEFAULT '0' COMMENT '审核状态（0 待审核 1 审核通过 2 审核不通过）',
  `remarks` varchar(500) NOT NULL DEFAULT '' COMMENT '备注',
  `is_del` int(1) NOT NULL DEFAULT '0' COMMENT '0正常，-1删除',
  `user_grade_id` bigint(20) NOT NULL DEFAULT '-1001' COMMENT '用户等级ID',
  `user_type` int(1) NOT NULL DEFAULT '0' COMMENT '用户类别(0 企业用户 1个人用户)',
  `user_card_id` varchar(255) NOT NULL DEFAULT '' COMMENT '统一信用代码 /身份证号码',
  `user_email` varchar(100) NOT NULL DEFAULT '' COMMENT '邮箱地址',
  `audit_time` datetime DEFAULT NULL COMMENT '审核时间',
  `audit_remarks` varchar(500) NOT NULL DEFAULT '' COMMENT '审核备注',
  `login_name` varchar(64) NOT NULL COMMENT '登录帐号',
  `password` varchar(100) NOT NULL COMMENT '登录密码',
  `country` varchar(100) NOT NULL DEFAULT '' COMMENT '国家',
  `province` varchar(100) NOT NULL DEFAULT '' COMMENT '省份',
  `city` varchar(100) NOT NULL DEFAULT '' COMMENT '城市',
  `district` varchar(100) NOT NULL DEFAULT '' COMMENT '区域',
  `address` varchar(400) NOT NULL DEFAULT '' COMMENT '联系地址',
  `company_en_name` varchar(255) NOT NULL DEFAULT '' COMMENT '公司名称（英文）',
  `company_en_address` varchar(400) NOT NULL DEFAULT '' COMMENT '公司地址（英文）',
  `legal_representative` varchar(255) NOT NULL DEFAULT '' COMMENT '法人代表',
  `enterprise_cn_contact` varchar(255) NOT NULL DEFAULT '' COMMENT '企业联系人（中文）',
  `enterprise_en_contact` varchar(255) NOT NULL DEFAULT '' COMMENT '企业联系人（英文）',
  `enterprise_fax` varchar(30) NOT NULL DEFAULT '' COMMENT '企业传真',
  `contact_line` varchar(25) NOT NULL DEFAULT '' COMMENT '联系人座机',
  `post_code` varchar(20) NOT NULL DEFAULT '' COMMENT '邮政编码',
  `business_license` varchar(300) NOT NULL DEFAULT '' COMMENT '营业执照',
  `qq` varchar(20) NOT NULL DEFAULT '' COMMENT 'QQ号',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of t_users
-- ----------------------------

-- ----------------------------
-- Table structure for t_user_payment
-- ----------------------------
DROP TABLE IF EXISTS `t_user_payment`;
CREATE TABLE `t_user_payment` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) DEFAULT NULL COMMENT '用户id',
  `sub_id` bigint(20) DEFAULT NULL COMMENT '科目id type==1为认证申请id type==2为标志申请id',
  `amount` decimal(10,2) DEFAULT '0.00' COMMENT '支付金额',
  `order_type` int(1) DEFAULT '1' COMMENT '订单类型 1认证申请首付款 2认证申请尾款 3标志申请',
  `pay_type` int(1) DEFAULT '1' COMMENT '支付方式( 1微信 2支付宝 3VISA 4线下支付)',
  `pay_no` varchar(255) DEFAULT '' COMMENT '单号',
  `transaction_number` varchar(255) DEFAULT '' COMMENT '交易号',
  `pic` varchar(255) DEFAULT '' COMMENT '支付凭证',
  `remark` varchar(255) DEFAULT '' COMMENT '备注',
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `lastupdate` datetime DEFAULT NULL,
  `status` int(1) DEFAULT '0' COMMENT '0未支付 1已支付 2已退款 ',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='用户支付记录';

