INSERT INTO `t_common_kv` VALUES ('13', '2019-09-27 14:16:11', '2019-09-27 14:45:55', '1', 'CONTPL_CONTENT', '&lt;p class=\"MsoBodyTextIndent2\" style=\"text-align: center; \"&gt;&lt;font face=\"仿宋_GB2312\"&gt;WSCT产品认证合同书&lt;/font&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;一、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;甲方乙方的职责和权益&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;（一）&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;甲方：&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;1、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;甲方自愿向乙方提出认证申请，已仔细阅读相关公开文件并按乙方要求提供认证申请书及有关附件材料，保证所提供材料真实性。保证所生产的此次申请所涉及的产品符合申请认证产品的国家标准及其它相关标准或规定，并保证获证产品符合国家其它相关法律法规的要求后方出厂销售。&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;2、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;甲方接受乙方按照认证规则、程序安排的现场审核，提供评价所需要的信息，为实施评价和监督（需要时）做出必要的安排，包括审查文件和记录、访问相关设备、场所、区域、人员、客户的分包方以及投诉的调查等，适用时，还包括观察员的参与，同时在接到乙方认证费用结算单后及时交纳认证费用。&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;3、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;甲方现场审核存在问题较多需要进行补充审核时，应按乙方的安排接受补充审核。&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;4、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;甲方获得认证证书后，在有效期内应保证产品持续符合认证要求，甲方有权在认证产品及宣传资料上使用乙方颁发的认证证书和在产品上按规定使用相应的认证标志&lt;/font&gt;,但甲方在使用证书和标志或进行有关认证宣传时，应正确表述认证范围不得采取模糊或暗示等误导的方式夸大认证范围。认证标志只能使用在认证证书所界定的工厂生产的认证范围内的产品上，甲方不得私自转让使用。在使用产品认证结果时，不得损害SMQ的声誉、不得做使SMQ认为可能误导或未经授权的有关产品认证的声明。&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;5、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;如果将认证文件的副本提供给其他人时，认证文件应被完整地复制。确保不采用误导的方式使用或部分使用认证测试报告、工厂检查报告、认证证书和认证标志。&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;6、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;甲方应保存已知的与认证要求符合性有关的所有投诉记录，并在&lt;/font&gt;SMQ要求时提供，包括对这些投诉以及在产品中发现的影响认证要求符合性的任何缺陷，采取适当的措施和相关的文件记录。&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;7、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;甲方在证书有效期内必须接受乙方安排的监督审核，按规定及时交纳年金等监督审核费&lt;/font&gt;,需要时，甲方还应接受国家认证认可监督管理委员会（CNCA）、中国合格评定国家认可委员会（CNAS）等主管机构的见证评审、专项监督。&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;8、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;当甲方认证产品或质量体系发生重大变化（如国家、省、市或地方监督抽查不合格）、顾客有重大投诉、组织机构、生产地址、联系方式发生变化、时，甲方应自上述情形&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;发生之日起&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;十&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;日内&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;及时通报乙方，乙方将视情增加监督审核次数，费用由甲方承担。&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;9、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;当监督结果为暂停、注销或撤销认证时，乙方将以书面方式通知甲方，在暂停期间或注销、撤销证书后，甲方应立即停止在宣传中使用认证证书或在产品上使用认证标志，如证书被暂停或变更认证范围，甲方应通知其相关顾客。&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;10、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;如证书被暂停的原因是由于获证产品有缺陷或存在安全隐患，可能危及人体安全和生命财产，甲方应积极采取相应措施（如停止生产、进行整改、产品召回等）以尽可能减少危害的产生，并将所采取的措施报告乙方。&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;11、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;甲方负担乙方派出的现场审核人员的差旅、食宿费用。&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;12、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;甲方有权就认证过程中产生的争议向&lt;/font&gt;CNAS、CNCA提出申诉。&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;span&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;（二）乙方：&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;1、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;乙方应按认证规则、程序的要求，对甲方的认证申请范围、场所实施现场审核，与甲方协商合理安排现场审核等评定工作，当甲方的申请符合获准认证的条件时，乙方应及时向甲方颁发认证证书。&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;2、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;乙方应和甲方协商，就每次现场审核人员和时间做出妥善安排，并以书面方式提前通知甲方。当甲方认证产品或质量体系发生重大变化（如国家监督抽查不合格）、顾客有重大投诉、组织机构、生产地址、联系方式发生变化时，乙方有权暂停证书并采取不事先通知的方式，对甲方实施例外的飞行检查。&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;3、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;审核人员应严格遵守审核员行为准则，认真履行审核员职责，对甲方的商业秘密履行保密义务并接受甲方的监督。&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;4、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;甲方获准认证后，乙方将按照相关认证实施规则的要求，对甲方实行正常监督。&lt;/font&gt;&lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=\"MsoNormal\"&gt;&lt;!--[if !supportLists]--&gt;&lt;span&gt;&lt;span&gt;5、&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span&gt;&lt;font face=\"仿宋_GB2312\"&gt;甲方应根据乙方的年度监督安排，接受年度监督审核。如逾期不能接受年度监督，乙方有权对甲方持有的证书做出暂停、撤销处理。&lt;/font&gt; &lt;/span&gt;&lt;span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;!--[if gte mso 9]&gt;&lt;xml&gt;&lt;w:WordDocument&gt;&lt;w:B